<ytd-mini-guide-entry-renderer
    class="style-scope ytd-mini-guide-renderer"
    aria-selected="false"
    role="tab"
    tabindex="0"
    aria-label="Home"
    ><!--css-build:shady--><a
        id="endpoint"
        tabindex="-1"
        class="yt-simple-endpoint style-scope ytd-mini-guide-entry-renderer"
        title="Home"
        href="/"

        <yt-icon
            id="icon"
            class="guide-icon style-scope ytd-mini-guide-entry-renderer"

                viewBox="0 0 24 24"
                preserveAspectRatio="xMidYMid meet"
                focusable="false"
                class="style-scope yt-icon"
                style="
                    pointer-events: none;
                    display: block;
                    width: 100%;
                    height: 100%;
                "
            >
                <g class="style-scope yt-icon">
                    <path
                        d="M10 20v-6h4v6h5v-8h3L12 3 2 12h3v8"
                        class="style-scope yt-icon"
                    ></path>
                </g></svg
            ><!--css-build:shady--></yt-icon
        >
        <span class="title style-scope ytd-mini-guide-entry-renderer"
            >Home</span
        >
        <tp-yt-paper-tooltip
            animation-delay="0"
            offset="4"
            position="right"
            class="style-scope ytd-mini-guide-entry-renderer"
            role="tooltip"
            tabindex="-1"
            hidden=""
            style="--paper-tooltip-delay-in: 0ms"
            ><!--css-build:shady-->

            <div id="tooltip" class="hidden style-scope tp-yt-paper-tooltip">
                Home
            </div>
        </tp-yt-paper-tooltip>
        <yt-interaction class="style-scope ytd-mini-guide-entry-renderer"
            ><!--css-build:shady-->
            <div class="stroke style-scope yt-interaction"></div>
            <div class="fill style-scope yt-interaction"></div
        ></yt-interaction>
    </a> </ytd-mini-guide-entry-renderer
